const app = getApp()
Page({
  onLoad() {
    this.ctx = wx.createCameraContext()
	  this.fileSysMgr = wx.getFileSystemManager()
  },
  data:{
    background:'data:image/png;base64,'
  },
  takePhoto() {
	  var that = this
    wx.chooseImage({
      count: 1,
      sizeType: 'compressed',
      sourceType: ['camera'],
      success: function (res) {
        const tempPath = res.tempFilePaths[0]
        wx.setStorageSync(app.globalData.storage_carimage_key, tempPath)
        wx.navigateTo({
          url: '/pages/show/show',
          success: function () {
          }
        })
        
      },
      fail: function (e) {

      }
    })
  },
  startRecord() {
    this.ctx.startRecord({
      success: (res) => {
        console.log('startRecord')
      }
    })
  },
  stopRecord() {
    this.ctx.stopRecord({
      success: (res) => {
        this.setData({
          src: res.tempThumbPath,
          videoSrc: res.tempVideoPath
        })
      }
    })
  },
  chooseImage() {
	  var that = this
	  wx.chooseImage({
		  count:1,
		  sizeType:'compressed',
      sourceType: ['album'],
		  success:function(res){
			  const tempPath = res.tempFilePaths[0]
			  that.fileSysMgr.readFile({filePath: tempPath, encoding: "base64", complete: function (res) {
				// 
				// that.getCarInfo(res.data)
				// that.setData({
				//   imgSrc:tempPath
			  // })
        // 
        const carImgData = {imgData:res.data, imgPath:tempPath}
          wx.setStorageSync(app.globalData.storage_carimage_key, carImgData)
          wx.navigateTo({
            url: '/pages/show/show',
            success: function () {
            }
          })
          }, fail: function (errorMsg) {
			  wx.hideLoading()
            console.log(errorMsg)
          }
        })
		  },
		  fail:function(e){
			  
		  }
	  })
  }
})